if mibBuilder.loadTexts: aal2VclTable.setStatus('current')
if mibBuilder.loadTexts: aal2VclTable.setDescription('The AAL2 Virtual Channel Link (VCL) Table This table contains configuration and state information of a bi-directional AAL2 Virtual Channel Link (VCL) at an ATM interface. Each VCL entry has an associated Connection Identifier (CID) table, comprised of one or more CID entries. Each VCL entry refers to an Audio Profile (AP) by type (pre-defined or user-defined) and index into an AP table. An AAL2 VCL entry is created by the agent when an RFC2515 (ATM-MIB) atmVclEntry of atmVccAalType 2 is created. Objects in the row entry can by modified by CLI or ZMS if the connection is down. Deletion of AAL2 VCL entries is controlled by the rfc2515 (ATM-MIB) atmVclRowStatus.')
aal2VclEntry = MibTableRow((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1), ).setIndexNames((0, "IF-MIB", "ifIndex"), (0, "ATM-MIB", "atmVclVpi"), (0, "ATM-MIB", "atmVclVci"))
if mibBuilder.loadTexts: aal2VclEntry.setStatus('current')
if mibBuilder.loadTexts: aal2VclEntry.setDescription("An entry in the AAL2 Virtual Channel Link (VCL) Table. Indexed by ifIndex, atmVclVpi from atmVclTable, and atmVclVci from atmVclTable. An AAL2 VCL entry or row (aal2VclEntry) is 'automatically' created by the agent when an rfc2515 (ATM-MIB) atmVclEntry with atmVccAalType 2 is created. The request to create an RFC2515 atmVclEntry can originate at either CLI or ZMS. Once the row exists, objects within the row with read-write access can by modified by CLI or ZMS if the connection is down. Deletion of an aal2VclEntry is managed by the rfc2515 (ATM-MIB) atmVclRowStatus. Note there is no RowStatus in the aal2VclEntry, whereas there is an atmVclRowStatus in the rfc2515 atmVclEntry.")
