if mibBuilder.loadTexts: atmVccAal2AppId.setStatus('current')
if mibBuilder.loadTexts: atmVccAal2AppId.setDescription("STR-VMOA-LES-01-00 4.1.1 Application Identifier (AppId) The Application Identifier (AppId) specifies protocol combinations used between IWFs. The following AppId values can be found at the ATM Forum public web site in section 5 of 'ATM Forum Well-known Addresses and Assigned Codes'. 0000000A Loop Emulation Service using CAS (POTS only) without ELCP 0000000B Loop Emulation Service using PSTN signalling (POTS only) without ELCP. Note: This application is not currently supported. 0000000C Loop Emulation Service using PSTN signalling (POTS only) with ELCP. Note: This application is not currently supported. 0000000D Loop Emulation Service using DSS1 in support of BRI (BRI only) without ELCP 0000000E Loop Emulation Service using DSS1 in support of BRI (BRI only) with ELCP. Note: This application is not currently supported. 0000000F Loop Emulation Service using CAS in support of POTS, and DSS1 in support of BRI (without ELCP). Note: This application is not currently supported. 00000010 Loop Emulation Service using PSTN signalling in support of POTS, and DSS1 in support of BRI (without ELCP).Note: This application is not currently supported 00000011 Loop Emulation Service using PSTN signalling in support of POTS,and DSS1 in support of BRI (with ELCP). Note: This application is not currently supported. 00000012 Loop Emulation Service using other variety of CCS. Note: This application is not currently supported. 00000013 Unspecified mode of Loop Emulation Service. Note: This application is not currently supported. 000000FF This is a Zhone proprietary application id and indicates that the protocol is Jetstream Aal2. By default this value is set to casPotsOnlyNoElcp.")
atmVccAal2VccI = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 2), Integer32()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: atmVccAal2VccI.setReference('STR-VMOA-LES-01-00 Section 4.1.2')
if mibBuilder.loadTexts: atmVccAal2VccI.setStatus('current')
if mibBuilder.loadTexts: atmVccAal2VccI.setDescription('STR-VMOA-LES-01-00 4.1.2 VCC Identifier (VCCI) To distinguish multiple VCCs, each shall be assigned a VCCI. The creator of an SVC shall assign its VCCI. The VCCI of a PVC is mutually provisioned. The VCCI shall be unique for all VCCs between a CP-IWF and a CO-IWF, but may be repeated with other CP-IWF/CO-IWF pairings. Between a CP-IWF and CO-IWF, a VCCI + CID pair is enough to identify an AAL2 channel.')
atmVccAal2SigVccI = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 3), Integer32()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: atmVccAal2SigVccI.setReference('STR-VMOA-LES-01-00 Section 4.1.3')
