if mibBuilder.loadTexts: atmVccAal2SigVccI.setDescription('STR-VMOA-LES-01-00 4.1.3 Signaling VCC Identifier (SigVCCI) If an AAL2 VCC is controlled by CCS, then SigVCCI = VCCI is indicated. Conversely if SigVCCI = VCCI then the AAL2 VCC contains CCS, which controls the AAL2 channels within that VCC.')
aal2VclAudioProfileIdentifier = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 4), Integer32().subtype(subtypeSpec=ValueRangeConstraint(1, 512))).setMaxAccess("readwrite")
