if mibBuilder.loadTexts: aal2VclAudioProfileIdentifier.setDescription('The Audio Profile for this VCL entry is specified by the Audio Profile identifier. The range of valid Audio Profile identifiers is well-defined. The Audio Profile identifier indexes into the AAL2 Audio Profile table containing the audio profiles corresponding to the specific identifier. For pre-defined audio profiles, the range of valid Identifier values is 1..255. From STR-VMOA-LES-01-00 Annex A, Identifiers defined by the ATM Forum are: * 1-6, allocated to af-vtoa-0113.000 * 7: PCM-64, ADPCM-32 and silence (pcm64Adpcm32Silence) * 8: PCM-64 and silence (pcm64Silence) * 9: PCM-64 without silence (pcm64) * 10: PCM-64, ADPCM-32 without silence (pcm64Adpcm32) *11-255: Reserved for future ATM Forum assignment If the Audio Profile is user-defined, the range of valid identifiers is 256..512. See the descriptions for the AAL2 Audio Profile tables.')
