if mibBuilder.loadTexts: aal2VclSscsDefaultType.setDescription('STR-VMOA-LES-01-00 4.1.4 SSCS Type The SSCS type that applies to each channel of an AAL2 VCC will vary according to the usage of that channel. Channels that are used to carry media streams (POTS or ISDN B-channels) shall use the SSCS defined in I.366.2. Channels that are used to carry control and management plane traffic (CCS, ELCP, ISDN D-channels and LES-EOC) shall use the SSCS defined in I.366.1. Channels that are used to carry Jetstream Voice shall use SSCS value of jetstreamvoice. Valid values are i3661 (I.366.1), i3662 (I.366.2), jetstreamvoice.')
