if mibBuilder.loadTexts: aal2VclMaxCidForAal2UserChannels.setDescription('Maximum CID value for AAL2 user channels. Valid range is 1..255. Maximum CID is 255. If the field atmVccAal2AppId is set to casPotsOnlyNoElcp then the valid range for aal2VclMinCidForAal2UserChannels and aal2VclMinCidForAal2UserChannels is between 16 and 128. If the field atmVccAal2AppId is set to dss1BriOnlyNoElcp then the valid range for aal2VclMinCidForAal2UserChannels and aal2VclMinCidForAal2UserChannels is between 129 and 223. Also the aal2VclMaxCidForAal2UserChannels must be greater than aal2VclMinCidForAal2UserChannels. For Jetstream app-id, this Cid value represents the port number which the phone is on and the valid range is 1 to 254. The range for non-Jetstream applications is 16 to 255. By default because atmVccAal2AppId is set to casPotsOnlyNoElcp the default value of this field is 127.')
