if mibBuilder.loadTexts: aal2VclAudioService.setDescription('The service provided is the transfer of audio signals (voice, voiceband data, and facsimile). The data unit traversing the SAP (SSCS SDU) contains either a voice encoding or a silence encoding. Silences are conveyed across the SAP either explicitly by a Silence Insertion Descriptor (SID) data unit, or implicitly by a Null data unit. Valid values are: - enabled. - disabled. - enabledEchoCancelOff: audio service enabled with echo cancellation and silence supression off. - enabledDynamic: audio service enabled with ability to dynamically disable silence supression, silence detection, echo cancellation and compression algorithms on a per-call basis.')
aal2VclCircuitModeData = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 13), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
