if mibBuilder.loadTexts: aal2VclCircuitModeData.setDescription('The service provided is the transfer of circuit mode data. The circuit mode data service is an emulation of the N*64 kbit/s (N = 1, 2, ..., 30) unrestricted, 8 kHz structured circuit mode service of Recommendations I.231.1 and I.231.10. The value N = 31 is also allowed. The value of N does not change during the lifetime of a call. Valid values are enabled and disabled. ')
aal2VclFrameModeData = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 14), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
