if mibBuilder.loadTexts: aal2VclFrameModeData.setDescription('Frame mode data is an intermittent data stream containing delimited units of information, possibly of varying size, with idle intervals between them. The service provided is the transport of data units as specified in the Transmission Error Detection service of Recommendation I.366.1. There is no assurance of data unit delivery, but if delivered, the relative sequence and the bit integrity of data units are assured. This service corresponds to the service provided by the Common Part of AAL type 5, Recommendation I.363.5, except that the option of corrupted data delivery is not available. Valid values are enabled and disabled. ')
aal2VclFaxDemoRemo = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 15), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
