if mibBuilder.loadTexts: aal2VclFaxDemoRemo.setDescription('Facsimile Demodulation/Remodulation is the process of detecting facsimile traffic, extracting digital information from the incoming analogue modulated signal, transporting this across a trunk in packet formats, and reproducing the facsimile control and image information by remodulation at the other end. The service provided is the transfer of demodulated facsimile image information and control information, from the demodulating User to the remodulating User. Valid values are enabled and disabled. ')
aal2VclCAS = MibTableColumn((1, 3, 6, 1, 4, 1, 5504, 4, 2, 1, 1, 1, 16), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("enabled", 1), ("disabled", 2)))).setMaxAccess("readwrite")
