if mibBuilder.loadTexts: aal2CidTable.setDescription('The AAL2 Channel Identifier (CID) Table The AAL2 Channel Identifier Table contains status, I.366.2 SSCS parameters, and I.366.1 SSCS parameters for the channel identifier. Default values for these objects are defined in the AAL2 VCL entry. Values in the AAL2 Channel Identifier entry can supercede the defaults specified in the AAL2 VCL entry. The maximum number of connections or CIDs allowed per ATM VCL is 255. Certain atmVccAal2AppID values (ie, any app running over Common Channel Signaling) can cause the auto-creation of an AAL2 CID entry. When the creation of an AAL2 VCL entry does not lead to the auto-creation of an AAL2 CID entry by the agent, a CLI or ZMS request from the CLI or ZMS can use the AAL2 CID entry RowStatus object, aal2CidRowStatus, to create an aal2CidEntry instance. In this case, an rfc2515 (ATM-MIB) atmVclEntry must exist prior to creating an AAL2 CID entry. AAL2 CID entry deletion is accomplished with the AAL2 CID entry RowStatus object, aal2CidRowStatus. If an AAL2 VCL entry is deleted, then the agent cleans up all associated AAL2 CID entries.')
