if mibBuilder.loadTexts: aal2Cid.setStatus('current')
if mibBuilder.loadTexts: aal2Cid.setDescription('The Channel Identifier is one of the indices for the CID table. The maximum number of connections allowed per ATM VCL is 255. Note that there are restrictions in the use of CID and in order to be LES compliant. The following assignments of AAL2 Channels and CID Allocation are specified in STR-VMOA-LES-01-00, Section 4.4. 0 Not used 1-7 Reserved for I.363.2 layer management 8 Some CPE manufactures use this CID for CCS and/or Emulated Loop Control protocol 9 If LES-EOC is supported, else not used. 10-15 for future revisions of STR-VMOA-LES-01-00 16-223 Bearer channels and ISDN D-channels 224-255 set aside for vendor-specific usage See STR-VMOA-LES-01-00 4.4 for allocation of CIDs when ELCP is not used, allocation of CIDs when ELCP is used, and implementation options for AAL2 CPS. If the ELCP is not used, the default assignment of CIDs to bearer channels and ISDN D-channels shall be as specified in this section. These default assignments may be overridden by provisioning or by management action. POTS ports at the CP-IWF shall be numbered from 1 to N, where N is the number of POTS ports that exist at the CP-IWF. CID = 16 shall be assigned to POTS port number 1, CID = 17 shall be assigned to POTS port number 2, and so on up to POTS port number N. For Jetstream applications, CID refers to port number and the valid range is 1 to 255. For non-Jetstream applications, the valid range is 16 to 255.')
